import headerLogo from '../img/header/header-logo.svg';
import React from 'react';

export default function Header({isLoggedIn, setLogged, userInfo, setUserInfo}) {
	return (
		<header className="header">
			<a href="#" target="_blank" className="header__link">
				<img className="header__logo" src={headerLogo} alt="Место Россия"/>
			</a>
			<div className="header__nav">
				{email && <div className="header__email">{pathname === MAIN ? email : ''}</div>}
				{loggedIn ? (
					<Link
						to={MAIN}
						onClick={() => {
							localStorage.setItem('token', '');
							setLoggedIn(false);
							setUserProfile('');
						}}
						className="authform__link"
					>
						Выйти
					</Link>
				) : (
					<Link to={path} className="authform__link">
						{pathname === SIGNIN ? 'Регистрация' : 'Войти'}
					</Link>
				)}
			</div>
		</header>
	);
}
